import './App.css';


const particlesOption ={
            		particles: {
            			number:{
                       value:30,
                       density:{

                       	enable:true,
                       	value_area:800
                       }

            		}

            	}
}

function App() {

  return (
    <div className="App">
    <Particles className='particles'
              params={particlesOption}

            />
     <Navigation />
    <Logo /> 
    <Rank />
     <ImageLinkForm />
     {/*
     <FaceRecognition />*/}
    </div>
  );
}

export default App;
